function App() {
  return (
    <div className="App">
      <div className="map_holder">
        <UIMap />
      </div>
    </div>
  );
}

export default App;

class UIMap extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      lat: 51.505,
      lng: -0.09,
      zoom: 13
    };
    this.onMapLoad = this.onMapLoad.bind(this);
    this.onMapClick = this.onMapClick.bind(this);
  }

  onMapLoad(map) {
    this.map = map;
    Helpers.drawGeoJSON(
      map,
      'test',
      geoJson,
      {
        'fill-opacity': 0.5,
        // 'fill-color': {
        //   'property': 'test',
        //   'stops': [
        //     [0, '#aa0b24'],
        //     [5, '#02bbb4']
        //   ]
        // }
      },
      (e) => {
        console.log(e);
      }
    );
    this.forceUpdate();
  }

  onMapClick(e) {
    console.log(e);
  }

  render() {
    const position = [this.state.lat, this.state.lng];
    return (
      <div style={{ height: '100%', width: '100%' }}>
        <MapboxMap
          ref={map => {
            this.map = map;
          }}
          onClick={this.onMapClick}
          zoom={10}
          maxZoom={12}
          accessToken="pk.eyJ1IjoieGxlYm5hOWFrcm9zaGthIiwiYSI6ImNqeHV0azVxazA0Y3gzZ21udTNoZHAxNjYifQ.FJdUfEfj6P3B9Iuw8zZ57Q"
          coordinates={{ lat: 51.505, lng: -0.09 }}
          onLoad={this.onMapLoad}
        />
      </div>
    );
  }
}

